#include <stdio.h>
#include <locale.h>
#include <errno.h>
#include <string.h>
#define MAXLINE 131072        /* this constrains line length */
int main(int argc, char *argv[]) {
  wchar_t in[MAXLINE];
  wchar_t out[MAXLINE];
  int return_value;
  wchar_t *ptr;

  setlocale(LC_ALL,"");

  errno = 0;
  ptr = fgetws(in,MAXLINE,stdin);
  while(ptr != NULL) {

    wchar_t *p = wcschr(in, '\n');
    if (p) { *p = '\0'; }  /* chomp */
					  
    return_value = t_accepts(in,out,MAXLINE);
    switch(return_value) {
    case 0:
      fprintf(stderr,"no\n");
      break;
    case 1:
      printf("%S\n",out);
      break;
    case 2:
      fprintf(stderr,"error: output line too long\n");
      break;
    }

    errno = 0;
    ptr = fgetws(in,MAXLINE,stdin);
  }
  if (errno) {
    fprintf(stderr,"%s error: %s\n",argv[0],strerror(errno));
  }
	                                /* end-of-file */
  return 0;
}

